import React from 'react';
import './Streamroom.css'
import Logo from './logo.jpg'

function Streamroom(){
    const styles={
        height:'20px',
        width:'20px'
    }
    return (
        <div className="stream">
           <div className="row">
              <img src={Logo} alt="img" style={styles} />
           </div>
        </div>
    );
}

export default Streamroom;
